import React from "react";
import PropTypes from "prop-types";

const styles = {
	txt: {
		fontFamily: fantasy
	}
}
function TodoItem(props) {
	return (
		<li>
			<span>
				<input type="checkbox" checked={props.checked}/>
				<strong>{props.idx + 1} </strong>
				{props.todo.title}
				<button>&times;</button>
			</span>
		</li>
	);
}

TodoItem.propTypes = {
	idx: PropTypes.number
};
export default TodoItem;
